import React from 'react'
import Item from './Item'
import { useCart } from '../context/CartContext'

function Cart() {
    //import store context
    const {products} = useCart()

  return (
    <div>
        {products.map((item)=>{
            return <Item key={item.id} />
        })}
    </div>
  )
}

export default Cart
